import React from 'react';

function Footer() {
	    return (
	      <footer className="text-muted text-center">
	      <ul className="list-inline mb-2">
	          <li className="list-inline-item"><a href="#home">Home</a></li>
	          <li className="list-inline-item pl-4"><a href="#page2">Page 2</a></li>
	          <li className="list-inline-item pl-4"><a href="#page3">Page 3</a></li>
	        </ul>
	      <div className="container">
	        <p>2020 Footer Example for WEBD171</p>
	      </div>
	    </footer>
	    )
}

export default Footer;
